import React from 'react'
import Layout from '../Components/Layout/Layout'
import img3 from '../images/img2.jpg';
import { Box } from '@mui/material';

function Home() {
  return (
    <>
    <Layout>
        <Box>
            <img src={img3} alt="img1" />
        </Box>
    </Layout>
    </>
  )
}

export default Home
